import React from "react";
import './Home.css';
import {Navbar} from "../../components"
import { Navigate } from "react-router-dom";

export default function Home() {
    let btnPlanningPressed = false;
    var btnSignupPressed = false;
    function goToPlanning() {
        btnPlanningPressed = true;
    }

    function pressSignup() {
        btnSignupPressed = true;
    }

    if (btnPlanningPressed) {
        btnPlanningPressed = false;
        return(<Navigate to="/trip_planning" />)
    }

    if (btnSignupPressed) {
        btnSignupPressed = false;
        return(<Navigate to="/signup" />)
    }

    return (
        <main className='home'>
            <header className='navbar'>
                <Navbar />
            </header>
            <body className="page-body">
                <div className="page">
                    <div className="text-left">
                        The <span>BEST</span> way to plan your trip is here!
                    </div>
                    <div className="text-right">
                        Having trouble planning your trip? We are here to help you!
                        <br></br>
                        <span className="logo-name"><span>T</span>rip<span>P</span>lanner</span> will plan the perfect trip especially for you.
                        <br></br>
                        So... are you ready to begin?
                        <div className="start-div">
                            <button className="btn-start" onClick={goToPlanning}>start planning</button>
                        </div>
                    </div>
                </div>
                <div className="signup-section">

                </div>
            </body>
        </main>
    )
}
